import { Button } from '@material-ui/core';
import './App.css';
import Grid from '@material-ui/core/Grid';
import Container from '@material-ui/core/Container';
import { styled } from '@mui/material/styles';
import heroImage from '../src/hero.svg'
import Box from '@material-ui/core/Box';

function Process() {
  return (
    <Container maxWidth="xl" style={{ background: '#154D43', position: "relative", height: "800px"}}>
     <Grid container spacing = {10} alignContent="flex-start"  alignItems="center" justifyContent="center"> 
        {/* <h1>Hi</h1> */}
        <Grid item xs={5}>
          <Box p={0}>
            {/* <img src = {heroImage} height = "600px" width = "600px"/> */}
          </Box>
        </Grid>
        <Grid item xs={5}>
          <Box bgcolor="secondary.light" p={0}>
            <h1 style={{fontFamily: 'yeseva one', fontSize: 80}}>Who Am I?</h1>
          </Box>
          <Grid item>
          <Box bgcolor="secondary.light" p={0}>
            <p style={{fontFamily: 'josefin sans', fontSize: 25}}>Thereâ€™s a smarter way to do business. A way that includes next-level services, a determined, relentless, and passionate consultant, and a unique perspective to help startups, founders, and visionaries get to the next level. </p>
          </Box>
        </Grid>
        <Grid item>
         <Button style={{fontFamily: 'montserrat', color: "white", backgroundColor: "#154D43", borderRadius: 10}}>Schedule a Meeting</Button>
        </Grid>
        </Grid>
        </Grid>
    </Container>
  )
}

export default Process;
